import React from "react";
import "./Header.css";

const Header = () => {
  return (
    <div>
      <h2>로고</h2>
      <input type="checkbox" id="icon" />
      <label htmlFor="icon">
        <span></span>
        <span></span>
        <span></span>
      </label>
    </div>
  );
};

export default Header;
